// SPDX-License-Identifier: MIT
// An example of a consumer contract that relies on a subscription for funding.
pragma solidity ^0.8.7;

import "@chainlink/contracts/src/v0.8/interfaces/LinkTokenInterface.sol";
import "@chainlink/contracts/src/v0.8/interfaces/VRFCoordinatorV2Interface.sol";
import "@chainlink/contracts/src/v0.8/VRFConsumerBaseV2.sol";
import "@chainlink/contracts/src/v0.8/KeeperCompatible.sol";

interface IERC20 {
  function totalSupply() external view returns (uint256);

  function balanceOf(address who) external view returns (uint256);

  function allowance(address owner, address spender)
    external view returns (uint256);

  function transfer(address to, uint256 value) external returns (bool);

  function approve(address spender, uint256 value)
    external returns (bool);

  function transferFrom(address from, address to, uint256 value)
    external returns (bool);

  event Transfer(
    address indexed from,
    address indexed to,
    uint256 value
  );

  event Approval(
    address indexed owner,
    address indexed spender,
    uint256 value
  );
}

contract Ownable {
  address private _owner;

  event OwnershipRenounced(address indexed previousOwner);
  
  event OwnershipTransferred(
    address indexed previousOwner,
    address indexed newOwner
  );

  constructor() {
    _owner = msg.sender;
  }

  function owner() public view returns(address) {
    return _owner;
  }

  modifier onlyOwner() {
    require(isOwner());
    _;
  }

  function isOwner() public view returns(bool) {
    return msg.sender == _owner;
  }

  function renounceOwnership() public onlyOwner {
    emit OwnershipRenounced(_owner);
    _owner = address(0);
  }

  function transferOwnership(address newOwner) public onlyOwner {
    _transferOwnership(newOwner);
  }

  function _transferOwnership(address newOwner) internal {
    require(newOwner != address(0));
    emit OwnershipTransferred(_owner, newOwner);
    _owner = newOwner;
  }
}

/**
 * @title The RandomNumberConsumerV2 contract
 * @notice A contract that gets random values from Chainlink VRF V2
 */
contract Airdrop is VRFConsumerBaseV2, Ownable ,KeeperCompatibleInterface  {
  
  IERC20 token;

  struct PaymentInfo {
    address payable payee;
    uint256 amount;
  }

  VRFCoordinatorV2Interface immutable COORDINATOR;
  LinkTokenInterface immutable LINKTOKEN;

  uint64 immutable s_subscriptionId;
  // The gas lane to use, which specifies the maximum gas price to bump to.
  // For a list of available gas lanes on each network,
  // see https://docs.chain.link/docs/vrf-contracts/#configurations
  bytes32 immutable s_keyHash;

  // Depends on the number of requested values that you want sent to the
  // fulfillRandomWords() function. Storing each word costs about 20,000 gas,
  // so 100,000 is a safe default for this example contract. Test and adjust
  // this limit based on the network that you select, the size of the request,
  // and the processing of the callback request in the fulfillRandomWords()
  // function.
  uint32 immutable s_callbackGasLimit = 100000;

  // The default is 3, but you can set this higher.
  uint16 immutable s_requestConfirmations = 3;

  // For this example, retrieve 10 random values in one request.
  // Cannot exceed VRFCoordinatorV2.MAX_NUM_WORDS.
  uint32 immutable s_numWords = 10;

  uint256[] public s_randomWords;
  uint256 public s_requestId;
  address s_owner;

  uint16 immutable max = 9;
  uint16 immutable min = 0;
  PaymentInfo[] airDropInfo;
  /**
  * Public counter variable
  */
  uint public counter;

  /**
  * Use an interval in seconds and a timestamp to slow execution of Upkeep
  */
  uint public immutable interval;
  uint public lastTimeStamp;

  event ReturnedRandomness(uint256 requestId, uint256[] randomWords);
  event AirDropDone(uint256[] randomWords);
  /**
   * @notice Constructor inherits VRFConsumerBaseV2
   *
   * @param subscriptionId - the subscription ID that this contract uses for funding requests
   * @param vrfCoordinator - coordinator, check https://docs.chain.link/docs/vrf-contracts/#configurations
   * @param keyHash - the gas lane to use, which specifies the maximum gas price to bump to
   */
  constructor(
    uint64 subscriptionId,
    address vrfCoordinator,
    address link,
    bytes32 keyHash,
    address _token,
    uint updateInterval
  ) VRFConsumerBaseV2(vrfCoordinator) {
    COORDINATOR = VRFCoordinatorV2Interface(vrfCoordinator);
    LINKTOKEN = LinkTokenInterface(link);
    s_keyHash = keyHash;
    s_owner = msg.sender;
    s_subscriptionId = subscriptionId;
    token = IERC20(_token);
    interval = updateInterval;
    lastTimeStamp = block.timestamp;
    counter = 0;
  }

  /**
   * @notice Requests randomness
   * Assumes the subscription is funded sufficiently; "Words" refers to unit of data in Computer Science
   */
  function requestRandomWords() external onlyOwner {
    // Will revert if subscription is not set and funded.
    s_requestId = COORDINATOR.requestRandomWords(
      s_keyHash,
      s_subscriptionId,
      s_requestConfirmations,
      s_callbackGasLimit,
      s_numWords
    );
  }

  /**
   * @notice Callback function used by VRF Coordinator
   * @param requestId - request id
   * @param randomWords - array of random results from VRF Coordinator
   */
  function fulfillRandomWords(uint256 requestId, uint256[] memory randomWords) internal override {
    s_randomWords = randomWords;
    emit ReturnedRandomness(requestId, randomWords);
  }

  function batchPayout(PaymentInfo[] calldata info) external onlyOwner {
      //airDropInfo = info;
      this.requestRandomWords();
      require(s_randomWords.length == 10 , "Random count must be 10.");
 
      for (uint i=0; i < s_randomWords.length; i++) {
          uint16 temp = uint16(s_randomWords[i] % (max - min + 1) + min);
          token.transfer(info[temp].payee,info[temp].amount);
      }
      emit AirDropDone(s_randomWords);
      delete s_randomWords;
  }
  function transfer(address to, uint256 amount) external onlyOwner {
      token.transfer(to, amount);
  } 

  function checkUpkeep(bytes calldata checkData) external view override returns (bool upkeepNeeded, bytes memory performData) {
      upkeepNeeded = (block.timestamp - lastTimeStamp) > interval;
      performData = checkData;
  }

  function performUpkeep(bytes calldata) external override {
      if ((block.timestamp - lastTimeStamp) > interval ) {
          lastTimeStamp = block.timestamp;
          if(airDropInfo.length > 10){
            this.batchPayout(airDropInfo);
          }
      }
  }  
}

